// ==UserScript==
// @name          YouTube - Custom colors and Poketube video progress bar
// @namespace     emukus
// @homepage      https://github.com/emukus
// @description	  Brighten up your YouTube experience with this custom video progress bar. The subtle yet vibrant glow brings some life and color to the YouTube HTML5 video player.
// @author        emukus
// @contributors  zoid, YAD
// @homepage      https://userstyles.org/
// @match         *://youtube.com/*
// @match         *://*.youtube.com/*
// @icon          data:image/gif;base64,
// @run-at        document-start
// @version       1.2
// ==/UserScript==
(function() {var css = [
	".html5-play-progress, .ytp-play-progress {",
    "   background: #46EFEB !important;" /* Old browsers */,
    "   background: -moz-linear-gradient(left, #1b1b1b 0%, #46EFEB 100%) !important;",
    "   background: -webkit-gradient(linear, left top, right top, color-stop(0%,#1b1b1b), color-stop(100%,#46EFEB)) !important;",
    "   background: -webkit-linear-gradient(left, #1b1b1b 0%,#46EFEB 100%) !important;",
    "   background: -o-linear-gradient(left, #1b1b1b 0%,#46EFEB 100%) !important;",
    "   background: -ms-linear-gradient(left, #1b1b1b 0%,#46EFEB 100%) !important;",
    "   background: linear-gradient(to right, #1b1b1b 0%,#46EFEB 100%) !important;",
    "}",
    ".html5-load-progress, .ytp-load-progress {",
	"   background:  url(\"data:image/gif;base64,\") !important;",
	"}",
	".ytp-scrubber-pull-indicator {"/*pika*/,
	"   background-color: #fff0;",
	"   height: 35px;",
	"   width: 45px;",
	"   background-image: url(data:image/gif;base64,), url(data:image/gif;base64,);",
	"   background-repeat: no-repeat;",
	"   background-position: center;",
	"   background-size: 43px,80px;",
	"   bottom: -5px;",
	"   left: -25.5px;",
	"   transform: rotate(0deg);",
	"	transform: scale(1.1);",
	"	border-radius: 30px",
	"}",
    /* scrubber button glow */
    ".html5-scrubber-button, .ytp-scrubber-button {",
    "   border-color: #1B1B1B !important;",
    "   box-shadow: 0px 0px 3px #46EFEB, 0px 0px 5px #46EFEB, 0px 0px 0px #46EFEB !important;",
    "   transition: box-shadow 0.2s, background 0.2s !important;",
    "}",
    /* scrubber button */
    ".ytp-swatch-background-color, .ytp-swatch-background-color-secondary, .html5-scrubber-button:hover, .ytp-scrubber-button:hover {",
    "   background-color: #3A3A3A !important;",
    "}",
    /* scrubber button glow on hover */
    ".html5-scrubber-button:hover, .ytp-scrubber-button:hover {",
    "   border-color: #1B1B1B !important;",
    "   box-shadow: 0px 0px 6px #46EFEB, 0px 0px 8px #46EFEB, 0px 0px 10px #46EFEB !important;",
    "}",
    /* volume control */
    ".ytp-volume-slider-track, .ytp-volume-slider-handle:before {",
    "   background: #46EFEB !important;" /* Old browsers */,
    "   background: -moz-linear-gradient(left, #1b1b1b 0%, #46EFEB 100%) !important;",
    "   background: -webkit-gradient(linear, left top, right top, color-stop(0%,#1b1b1b), color-stop(100%,#46EFEB)) !important;",
    "   background: -webkit-linear-gradient(left, #1b1b1b 0%,#46EFEB 100%) !important;",
    "   background: -o-linear-gradient(left, #1b1b1b 0%,#46EFEB 100%) !important;",
    "   background: -ms-linear-gradient(left, #1b1b1b 0%,#46EFEB 100%) !important;",
    "   background: linear-gradient(to right, #1b1b1b 0%,#46EFEB 100%) !important;",
    "   z-index: -117;",
    "}",
   /* volume slider handle */
    ".ytp-volume-slider-handle {",
    "   background-color: #46EFEB !important;",
    "}",
    /* extras */
    ".ytp-settings-button.ytp-hd-quality-badge::after, .ytp-settings-button.ytp-4k-quality-badge::after, .ytp-settings-button.ytp-5k-quality-badge::after, .ytp-settings-button.ytp-8k-quality-badge::after, .ytp-settings-button.ytp-3d-badge::after {",
    "   background-color: #46EFEB !important;",
    "}",
    ".ytp-swatch-color {",
    "   color: #46EFEB !important;",
    "}",
    ".ytp-menuitem[aria-checked=true] .ytp-menuitem-toggle-checkbox {",
    "   background: #46EFEB !important;",
    "}",
    ".ytp-chrome-controls .ytp-button.ytp-youtube-button:hover:not([aria-disabled=true]):not([disabled]) .ytp-svg-fill-logo-tube-lozenge {",
    "   fill: #46EFEB !important;",
    "}",
    ".ytp-cued-thumbnail-overlay:hover .ytp-large-play-button-bg, .ytp-large-play-button.ytp-touch-device .ytp-large-play-button-bg {",
    "   fill: #46EFEB !important;",
    "}",
    ".resume-playback-progress-bar {",
    "   background: #46EFEB !important;",
    "}",
    ".ytp-chrome-controls .ytp-button[aria-pressed]::after {",
    "   background-color: #46EFEB !important;",
    "}",
    ".yt-uix-checkbox-on-off input[type=checkbox]:checked + label {",
    "   background-color: #46EFEB !important;",
    "}",
    ".video-extras-sparkbar-likes {",
    "   background-color: #46EFEB !important;",
    "}",
    ".ytp-autonav-toggle-button {",
	"	background:none #6f6868!important;",
	"	box-shadow: inset 0px 0px 0px 2px #4a4947;",
	"}",
	"",
	".ytp-autonav-toggle-button[aria-checked=\"true\"] {",
	"    background-image:none!important;",
	"    background-color: #46EFEB!important;",
	"	box-shadow: inset 0px 0px 0px 2px #c18c0c;",
	"}"
].join("\n");
if (typeof GM_addStyle != "undefined") {
	GM_addStyle(css);
} else if (typeof PRO_addStyle != "undefined") {
	PRO_addStyle(css);
} else if (typeof addStyle != "undefined") {
	addStyle(css);
} else {
	var node = document.createElement("style");
	node.type = "text/css";
	node.appendChild(document.createTextNode(css));
	var heads = document.getElementsByTagName("head");
	if (heads.length > 0) {
		heads[0].appendChild(node);
	} else {
		// no head yet, stick it whereever
		document.documentElement.appendChild(node);
	}
}
})();